def solve(n, x, a, i=0, ans=0):
    if i == n:
        return max(ans, (x - a[i-1]) * 2)
    if a[i] > (x - a[i]) * 2:
        return max(solve(n, x, a, i+1, a[i]), ans)
    else:
        return max(solve(n, x, a, i+1, (x - a[i]) * 2), ans)

