def solve():
    n = int(input())
    a = list(map(int, input().split()))
    while True:
        sorted_a = [0] * n
        sorted_idx = 0
        for i in range(n):
            if not sorted_a[i]:
                val = a[i]
                j = i + 1
                while j < n and a[j] <= val:
                    val = a[j]
                    j += 1
                sorted_a[i:j] = [val] * (j - i)
                sorted_idx = max(sorted_idx, j)
        if sorted_a == a:
            return "YES"
        else:
            for i in range(n):
                a[i] -= 1
    return "NO"

