import sys

def solve():
    pin = input()
    n = len(pin)
    dp = [[0 for _ in range(10)] for _ in range(n)]

    # Initialize first row of dp table
    for j in range(10):
        if j == int(pin[0]):
            dp[0][j] = 1
        elif j != 9 and j != 0:
            dp[0][j] = 2
        else:
            dp[0][j] = 3

    # Fill in the rest of the dp table
    for i in range(1, n):
        for j in range(10):
            if j == int(pin[i]):
                dp[i][j] = min(dp[i-1][:]) + 1
            elif j != 9 and j != 0:
                dp[i][j] = min(dp[i-1][max(j-1, 0):min(j+2, 10)]) + 1
            else:
                dp[i][j] = min(dp[i-1][:]) + 3

    # Find the minimum value in the last row of the dp table
    return min(dp[-1])

