def solve(pin):
    n = len(pin)
    memo = {}

    def dp(i, j):
        if (i, j) in memo:
            return memo[(i, j)]

        if i == 0:
            result = abs(j - int(pin[i]))
        else:
            min_val = float('inf')
            for k in range(10):
                min_val = min(min_val, dp(i-1, k) + abs(k-j) + 1)
            result = min_val

        memo[(i, j)] = result
        return result

    print(dp(n-1, int(pin[-1])))

