        s.append((x, y))
    s.sort(key=lambda x: (x[0], -x[1]))
    ans = 2 * sum(x for _, x in s)
    h = defaultdict(int)
    for i in range(n):
        if not h[s[i][1]]:
            heappush(h[s[i][1]], s[i][0])
        else:
            while h[s[i][1]] and h[s[i][1]][0] >= s[i][0]:
                heappop(h[s[i][1]])
            heappush(h[s[i][1]], s[i][0])
    for height in h.values():
        ans -= 2 * (height[0] + height[-1])
    print(ans)

