def solve(s, cnt):
    if not s:
        return 0
    idx = ord(s[0]) - ord('A')
    if not cnt[idx]:
        return 2 + solve(s[1:], [x+1 for x in cnt])
    else:
        return 1 + solve(s[1:], [x+1 for x in cnt])

