def solve():
    n = int(input())
    d = 2
    while True:
        ans = []
        for i in range(1, n + 1):
            if i % d == 0 and i // d > 0:
                ans.append(i // d)
            else:
                ans.append(d * (i // d))
        cost = sum(1 for i in range(len(ans) - 1) if ans[i] * d == ans[i + 1])
        if cost == n - 1:
            break
        d += 1
    print(d)
    print(*ans)

