import sys

def solve(n, m, i=1, j=1):
    if n == 1 and m == 1:
        return (n - 1) * m + m
    elif n > 1 and m > 1:
        return min(solve(n-1, m, i+1, j), solve(n, m-1, i, j+1)) + (i-1)*m+j
    elif n > 1:
        return solve(n-1, m, i+1, j) + (i-1)*m+j
    else:
        return solve(n, m-1, i, j+1) + (i-1)*m+j
